import { Injectable } from "@angular/core";

@Injectable({
  providedIn: 'root',
})
export class LocalStorageService {
    storageName: "logs"


    setData(data: any) {
        localStorage.setItem(this.storageName, data)
    }

    getData(): any {
        return localStorage.getItem(this.storageName)
    }
}
